INSERT INTO `faqs` (`id`, `categoryID`, `question`, `answer`, `created_at`, `updated_at`) VALUES
(8, 8, 'Yurt Dışı Gönderiminde Hacimsel Ağırlık (Desi) Nasıl Hesaplanır?', 'Yayınlanma : 21 Nisan 2021\r\nHacimsel ağırlık (Desi), yurt dışına kargo gönderenler için önemli bir ölçü birimidir. Kargo bedelinin hesaplanmasında kullanılır.\r\n\r\nBu hesaplamada, yük ağırlığı önemli olduğu kadar hacimsel ağırlık da fazlasıyla önemlidir. Örneğin; Türkiye’den ABD’ye gidecek numune gönderiminiz için kargo ücretinizin ne kadar tutacağını merak ediyorsunuz. Öncelikli olarak desi hesaplama formülünü kullanarak ürünün ölçümü yapılmalıdır. Böylelikle ürünün kapladığı alanın ne kadar olduğu belirlenecektir. Akabinde ürünün gerçek ağırlığı (kg) ölçülüp, hangisi daha yüksekse fiyatlandırma ona göre yapılacaktır.\r\n\r\nBuna bağlı olarak şunları söyleyebiliriz ki:\r\nÜrün ölçümleri doğru bir fiyatlandırma için büyük bir önem arz etmekte. Aksi takdirde kolinin; yanlış ölçülmüş boyutları, yanlış tartılmış kg’ı göndericiye de yanlış bir fiyatlandırma ile geri dönecektir.\r\nÜrün gereğinden fazla büyüklükte paketlenirse, ebatları yine çok fazla çıkacak dolayısıyla hacimsel ağırlık da fazla olacaktır. Gereksiz fiyatlardan kaçınmak için bu konuya da dikkat edilmelidir.\r\nPeki, bahsedilen “Hacimsel Ağırlık” Formülü Nedir?\r\n\r\nEN x BOY x YÜKSEKLİK/HACİMSEL BÖLEN (5000)\r\n\r\nÖrnek olarak, Türkiye’den ABD’ye gidecek numune gönderilerinizden bahsetmiştik. Detayları ise;\r\nKg: 10\r\nEbat: 20*35*55 olsun.\r\nVerilen ürün detayları desi hesaplama formülüne uyarlanırsa:\r\n20x35x55 / 5000 = 7,7\r\nSonucu elde edilir.\r\nFiyatlandırma aşamasında yüksek çıkan ağırlığın baz alınacağını belirtmiştik.\r\nGerçek ağırlık 10 kg iken hacimsel ağırlık 7,7’dir. Böylelikle esas alınan değer de 10 kg olacaktır.\r\nDiğer bir örnek ise;\r\nKg: 18\r\nEbat: 70*70*35\r\nVerilen ürün detayları desi hesaplama formülüne uyarlanırsa:\r\n70x70x35 /5000 = 34,3\r\nSonucu elde edilir.\r\nGerçek ağırlık 18kg iken hacimsel ağırlık 34,3’dür. Böylelikle esas alınan değer de 34,3 desi olacaktır.\r\n\r\nSizde yurt dışına göndermek istediğiniz ürünlerin net ölçüleri ile SHIPLOUNGE dan en avantajlı fiyatları elde edebilirsiniz. trkargom.com adresi üzerinden “Hemen Teklif Al” butonunu kullanarak 230 ülkeye anında taşıma teklifi alabilirsiniz.\r\n\r\nSHIPLOUNGE  ekibi tüm kargo sürecinizde size destek olmak için hazır!', '2022-05-02 08:20:02', '2022-05-11 05:11:14'),
